import React, { Fragment } from "react";

class TableBodyFrag extends React.Component {
  render() {
    return (
      <Fragment>
        <td>Mark Steadman</td>
        <td>Accessibility Advocate</td>
      </Fragment>
    );
  }
}
export default TableBodyFrag;
